function cell_color(cell, formatterParams) {
    var value = cell.getValue();
    if (value == "—")
        return value;
    if (value >= formatterParams["thres"][0])
        cell.getElement().style.backgroundColor = "rgba(255, 0, 0, 0.3)";
    else if (formatterParams["thres"][0] > value && value >= formatterParams["thres"][1])
        cell.getElement().style.backgroundColor = "rgba(255, 0, 0, 0.2)";
    else if (formatterParams["thres"][1] > value && value >= formatterParams["thres"][2])
        cell.getElement().style.backgroundColor = "rgba(255, 0, 0, 0.1)";
    else
        cell.getElement().style.backgroundColor = "#fff";
    // alert(JSON.stringify(cell.getElement().style["background-color"]));
    return value;
}

